import React from 'react';
import { NavLink } from 'react-router-dom';
import web from "../src/images/img2.jpg";

const Home = () => {
    return (
        <>
            <section id="header" className="d-flex align-items-center">
                <div className="container-fluid nav_bg">
                    <div className="row">
                        <div className="col-10 mx-auto">
                            <div className="row">
                            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                                <h1>Don't worry. We are here for <strong className="brand-name">every solution.</strong></h1>
                                <h2 className="my-3">Bushwick meh Blue Bottle pork belly mustache skateboard 3 wolf moon. </h2>
                                <div className="mt-3">
                                    <NavLink to="/" classsName="btn-get-started "> Get Started </NavLink>
                                    {/* <a href="" className="btn-watch-video">Watch Video</a> */}
                                </div>
                            </div>
                            <div className="col-lg-6 order-1 order-lg-2 header-img">
                                <img src={web} className="img-fluid animated" alt="home img" />
                            </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};
export default Home;
